const getYoutubeData = async () => {
  try {
    const response = await axios.get(
      "https://www.googleapis.com/youtube/v3/videos", {
      params: {
        part: "snippet",
        id: "your_video_id",
        key: AIzaSyD7oceCmTfzCji0ORDsO5PwiIUuWe6nCF8,
      }
    });
    console.log(response.data);
  } catch (error) {
    console.error(error);
  }
}
